import React, { Component } from 'react'

export default class about extends Component {
  render() {
    return (
      <div>
        <h2>About</h2>
        <p>
          Pagina Server Side Render created by pabtab
        </p>
        <img src="/static/about.png" alt="about my webpage" />
      </div>
    )
  }
}
